import Spinner from "react-spinner-material";
import React from "react";

const Loader = () => {
    return (
        <div>
            <Spinner
                size={80}
                spinnerColor="#0b64eb"
                spinnerWidth={7}
                visible={true}
            />
        </div>
    );
};

export default Loader;
